import React from 'react';

const Contact = () => {
  return (
    <section id="contact" className="contact">
      <h2>Contact Me</h2>
      <p>Email: [Your Email]</p>
      <p>GitHub: [Your GitHub Link]</p>
      <p>LinkedIn: [Your LinkedIn Link]</p>
    </section>
  );
};

export default Contact;
